@import url('https://fonts.googleapis.com/css2?family=Roboto:wght@300;400;500;700&display=swap');


/* variables de color */
:root {
  --base-black: #0d1b1c;
  --contrast-purple: #825377;
  --light-cream: #e8e5dc;
  --white: rgb(255, 255, 255);

  --text-color: var(--base-black);
  --footer-bg-color: var(--base-black);
  --contrast-color: var(--contrast-purple);
  --light-contrast-color: var(--light-purple);
  --footer-hover-link: var(--contrast-purple);
  --link-color: var(--contrast-purple);
  --hover-link-color: var(--base-black);
  --footer-link: var(--white);
  --font-family: "roboto", Arial, Helvetica, sans-serif;
}



body {
  height: 100vh;
  color: var(--base-black);
  background: var(--light-cream);
  margin: 0;
  padding: 0;
  font-family: var(--font-family);
}



.logo {
  width:190px;
  margin-top:0.5rem;
}

.logo_footer{
  margin-top: 1.5rem;
}

a {
  text-decoration: none;
}

a h3 {
  color: var(--contrast-purple);
  text-decoration: none;

}

a h3:hover  {
  color: var(--base-black);

}


/* header */ 

.header {
  z-index: 2;
  background-color: rgba(255, 255, 255, .9);
  grid-template-columns: auto auto;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  padding-left: 0rem;
  padding-right: 4rem;
  display: flex;
  position: fixed;
  top: 0;
  border: solid 1px #111;
  flex-direction: row;
}

.nav {
  padding-right: 20px;
}


.nav_item {
  color: var(--contrast-purple);
  align-items: center;
  height: 100%;
  margin-right: 30px;
  font-size: 1.1rem;
  font-weight: 300;
  transition: all .3s cubic-bezier(.075,.82,.165,1);
  position: relative;
  text-decoration: none;
  font-weight: 400;
}

a.nav_item:hover {
  color: var(--base-black);
}



/* nav toggle */ 

nav.menuHTML {
  display: none;
}


/* Style the dropdown menu */
#trickMenu {
  display: none;
  position: absolute;
  top: 100%;
  left: 0;
  width: 100%;
  background-color: var(--contrast-purple);
  flex-direction: row;
  justify-content: space-around;
  padding: 10px 0;
  z-index: 4;
  margin-top: 0rem;
}

#trickMenu li {
  list-style: none;
  color: var(--white);
}

#trickMenu a {
  color: white;
  text-decoration: none;
  padding: 10px 15px;
  display: block;
}

#trickMenu a:hover {
  background-color: #575757;
  border-radius: 5px;
}

/* Show the menu when the checkbox is checked */
#menu-toggle:checked + label + #trickMenu {
  display: flex;
}



/* hero */ 

  .hero {
    height: 25rem;
    background-position: center center;
    background-repeat: no-repeat;
    background-size: cover;
    display: flex;
    justify-content: center;
    align-items: center;
    margin-top: 76px;
    max-width: 1040px;
    margin: 8rem auto 0rem;
  }

  .hero-text, .video-mask {
    width: 37rem;

}

.video-mask iframe {
  border: none;
  width: 565px;
  height: 375px;
  position: relative;
  top: 22px;
  left: 0;
  mask-image: url('../images/cloud.svg'); /* Ruta a tu imagen SVG para la máscara */
  mask-size: 100%;
  mask-repeat: no-repeat;

}
.container {
  position: relative;
}

.breadcrumb {
  position: absolute;
  top: 20px; /* Ajusta la posición vertical según necesites */
  left: 20px; /* Ajusta la posición horizontal según necesites */
  z-index: 2; /* Asegura que el breadcrumb esté por encima del hero */
  padding: 1rem 16vw;
  margin-top: 80px;
}

  .breadcrumb a:hover {
  color: var(--base-black);

   }

.img_responsive img {
  width: 100%;
  height: auto;
}


.hero-actualidad {
  background-image: url('../images/raices.svg');
  display: flex;
  flex-direction: row;
  align-items: center; /* Align items vertically in the center */
  justify-content: space-between; /* Add space between the items */
  background-repeat: no-repeat;
  background-position: center;
  width: 100%;
  padding: 20px; /* Optional: Add some padding */
  box-sizing: border-box; /* Ensure padding is included in the element's total width and height */
  background-size: 59%;
}


.hero-container {
  position: relative;
  display: flex; /* Activar el modelo de caja flexible */
  justify-content: center; /* Alinear horizontalmente el contenido al centro */
  align-items: center; /* Alinear verticalmente el contenido al centro */
  overflow: hidden;
  height: 61vh;
  top: 6rem;
}




.hero-img {
  -webkit-flex: 0 0 auto;
  -moz-box-flex: 0;
  flex: 1;

  padding-top: 6rem;
}

.hero-text {
  text-align: center; /* Alinear el texto al centro horizontal */
  flex: 1; /* Grow to take up available space */
  padding: 20px; /* Optional: Add padding for better spacing */
}


.hero-img img {
  max-width: 100%; /* Ensure the image is responsive */
  height: auto; /* Maintain the aspect ratio */
}
svg#R {
  width: 7rem;
}


.clip-path {
  width: 300px;
  height: 260px;
  background-size: cover;
  background-image: url(/assets/images/TodoLoQueAmaste.png);
  clip-path: ellipse(37% 41% at 50% 50%);
  animation: wiggle 5s infinite;
}

.path {
  stroke-dasharray: 2740;
  stroke-dashoffset: 3000;
  animation: dash 2s linear forwards;
}

@keyframes dash {
  to {
    stroke-dashoffset: 0;
  }
}
@keyframes wiggle {
  0% {
    clip-path: ellipse(37% 41% at 50% 50%);
  }
  25% {
    clip-path: ellipse(42% 39% at 50% 50%);
  }
  50% {
    clip-path: ellipse(32% 43% at 50% 50%);
  }
  75% {
    clip-path: ellipse(38% 40% at 50% 50%);
  }
  100% {
    clip-path: ellipse(37% 41% at 50% 50%);
  }
}

#svg-music {
